import React, {useState, useEffect} from 'react'
import HeaderExamine from "../components/HeaderExamine"
import { useParams } from 'react-router-dom';
import {Container  } from "react-bootstrap"; 
import { Form, Table, Button } from "react-bootstrap";



const RésultatsExamine = () => {
  const { id } = useParams();
  const [mes_examens_corriges, setMes_examens_corriges]= useState([]);

  //retourne les ids des examens corriges où l'examine est invité 
  const getExams = async () => {
    try {
      const response = await fetch(
        `http://localhost:3001//mes_examens_corriges/${id}`
      );
      const jasonData = await response.json();
      setMes_examens_corriges(jasonData);
    } catch (err) {
      console.error(err.message);
    }
  };




  return (
    <div>
      <HeaderExamine/>

      <Container fluid className="contentContainer" style={{ backgroundColor: 'rgba(142, 202, 230, 0.34)', 
      minHeight: '100vh' , padding: '20px 0' }}>
        <h1>Mes résultats d'examen</h1>

        
      </Container>
      
    </div>
  )
}

export default RésultatsExamine
